import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './components/home/Home';
import Login from './components/login/Login';
import Profile from './components/profile/Profile';
import Wallet from './components/wallet/Wallet';
import Products from './components/product/Products';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <Routes>
              <Route exact path='/home' Component={Home}></Route>
              <Route exact path='/login' Component={Login}></Route>
              <Route exact path='/profile/:userId' Component={Profile}></Route>
              <Route exact path='/wallet/:userId' Component={Wallet}></Route>
              <Route exact path='/products/:userId' Component={Products}></Route>
              <Route exact path='/home/:userId' element={<div className="home-page"><Home /></div>} />             
            </Routes>
          </BrowserRouter>
    </div>
  );
}

export default App;
